import React from 'react';
import reg from './loginPic.jpg';
const About =()=>{
    return(
        <>
            <div className="container emp-profile">
                <form method="">
                    <div className="row">
                        <div className="col-md-4">
                            <img src={reg} alt="profile"/>
                        </div>
                        <div className="col-md-6">
                        </div>

                    </div>

                </form>

            </div>
        </>
    )
}
export default About;
